# Zonebuilders
## Cross-platform and language-agnostic tools for generating zoning systems for urban analysis and modelling
### Robin Lovelace, Martijn Tennekes, Dustin Carlino, FOSS4G 2021

---













.left-column[

# Why?

- Every city has a different zoning system
- Need for consistency when doing inter-city comparisons
- Need for a general solution
- Existing 'zone-building' systems start with 'basic statistical units' (BSUs)
- Fun FOSS programming challenge!

]

--

## Create zones in one command


```r
london_zones &lt;- zb_zone(london_c(), london_a())
zb_plot(london_zones)
```

&lt;img src="index_files/figure-html/unnamed-chunk-8-1.png" width="100%" /&gt;

---

# Output the results


```r
sf::write_sf(london_zones, "london_zones.geojson")
```

## With the Rust crate

### See https://github.com/zonebuilders/zonebuilder-rust

Install Rust + cargo

```bash
cargo install zonebuilder
```

See the help with:


```bash
zonebuilder -h
```

```
## zb 0.1.0
## Configures a clockboard diagram
## 
## USAGE:
##     zonebuilder [FLAGS] [OPTIONS]
## 
## FLAGS:
##     -h, --help         Prints help information
##         --projected    Is the data projected?
##     -V, --version      Prints version information
## 
## OPTIONS:
##     -d, --distances &lt;distances&gt;...
##             The distances between concentric rings. `triangular_sequence` is useful to generate these distances
##             [default: 1.0,3.0,6.0,10.0,15.0]
##     -s, --num-segments &lt;num-segments&gt;
##             The number of radial segments. Defaults to 12, like the hours on a clock [default: 12]
## 
##     -v, --num-vertices-arc &lt;num-vertices-arc&gt;
##             The number of vertices per arc. Higher values approximate a circle more accurately [default: 10]
## 
##     -p, --precision &lt;precision&gt;
##             The number of decimal places in the resulting output GeoJSON files. Set to 6 by default. Larger numbers mean
##             more precision, but larger file sizes [default: 6]
```

# Next steps

.pull-left[

## Conceptually

- How much can the ClockBoard concept catch on?
- What alternative zoning systems can be imagined/created?
- How to design a zoning system incorporating multiple city centres?

]

.pull-right[

## Technologically

- Fix any outstanding bugs in R and Rust implementations
- Add features to R and Rust implemenations
- Zonebuilder implementations in other languages
  - Python, JavaScript, Julia, Go? Great geo learning exercise.
  - Interfaces to the Rust implementation, e.g. via [rextendr](https://github.com/extendr/rextendr) R package and the [pyo3](https://github.com/PyO3/pyo3) Python package
- Create standard zones ready to be used for major cities worldwide

]
